import "./App.css";

class App extends React.Component {
  state = {
    word: "well",
  };

  getWord = () => { 
    this.setState({ word: "ok"})
  }
  render() {
    return (
      <div className="App">
        <p>{this.state.word}</p>
      </div>
    );
  }
}

export default App;
